import React from 'react';
import { Button, useTheme, ThemeProvider, createTheme } from '@mui/material';

const CreateNewEvent = () => {
    const theme = useTheme(); // 获取主题

    const handleCreateNewEvent = () => {
        console.log('Create New Event clicked');
        window.location.href = '/create-new-event';
    };

    return (
        <Button 
            color="primary" 
            variant="contained" 
            sx={{ 
                mr: 1,
                ':hover': {
                    // 使用可选链操作符(?.)确保不会在theme.palette.primary为undefined时尝试访问main属性
                    boxShadow: `0 0 8px ${theme.palette.primary?.main}`, 
                },
                fontWeight: 'bold',
                padding: theme.spacing(1, 4),
            }} 
            onClick={handleCreateNewEvent}
        >
            Create New Event
        </Button>
    );
};

// 确保使用ThemeProvider包裹您的应用或组件树的根部
const App = () => (
    <ThemeProvider theme={createTheme()}>
        <CreateNewEvent />
    </ThemeProvider>
);

export default App;
